import './App.css';
import Footer from './Footer/Footer';
import Main from './Main/Main';
import Navbar from './Navbar/Navbar';
import { Routes, Route, BrowserRouter } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main />}></Route>
        </Routes>
      </BrowserRouter>

      <Footer />
    </div>
  );
}

export default App;
